import './layout.css';
import styled from 'styled-components';
import Hero from '../components/ui/hero';
import Navbar from './navbar';

const Styled = styled.div``;

const Layout = ({ children }) => {
  return (
    <>
      <Hero heroSize>
        <Navbar />
      </Hero>
      {children}
    </>
  );
};

export default Layout;
